Interesting, seems like adding assume causes the unit test to fail. I wonder if this is due to the fact that the testis now being run with the parameterized running vs the standard junit runner. My assumption would be that all Junit provided runners would behave the same, but that may not be true since they call out to it in their Javadoc: https://junit.org/junit4/javadoc/4.12/org/junit/Assume.html

"The default JUnit runner skips tests with failing assumptions. Custom runners may behave differently."

@yschimke : I'm going to go back to the simple if check and return.
